import React from 'react';

const Frame10 = ({
  imageSrc = '/frame10.png',
  altText = 'Frame 10',
  imageStyle = {}
}) => {
  return (
    <div
      style={{
        width: '1440px',
        height: '338px',
        background: 'rgba(28,38,76,1)',
        padding: '40px 70px',
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'center',
        alignItems: 'center',
        boxSizing: 'border-box',
      }}
    >
      <div
        style={{
          display: 'flex',
          flexDirection: 'row',
          gap: '120px', // Figma gap
          width: '1301px',
          height: '204px',
          alignItems: 'center',
          background: 'rgba(28,38,76,1)',
        }}
      >
        <img
          src={imageSrc}
          alt={altText}
          style={{
            width: '1301px',
            height: '204px',
            objectFit: 'cover',
            background: 'rgba(28,38,76,1)',
            borderRadius: '0px',
            ...imageStyle
          }}
        />
      </div>
    </div>
  );
};

export default Frame10;
